import {
  ADD_USER,
  LOGIN,
} from '../constants/action-type'

export const addUser = user => {
  fetch('http://localhost:3000/signup', {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(user)
  })
  return { type: "ADD_USER", payload: user }
}
